import React, { Component } from "react";

export class Category2 extends Component {
  render() {
    return (
      <div>
        <div>
          <div className="category_half">
            <h2>Kategorija:</h2>
          </div>
          <div className="linebreak"></div>
          <div>
            <Category_items2 />
          </div>
        </div>

        <div className="category_half">
          <div className="category_name">
            <h2>Kategorija:</h2>
          </div>
          <div className="linebreak"></div>
          <div>
            <Category_items2 />
          </div>
        </div>
      </div>
    );
  }
}

export default Category2;
